import React from "react";
import { useState } from "react";

const Tasks = () => {
  const [tasks, setTasks] = useState([
    {
      id: 2,
      text: "Doctor ap",
      day: "sunday",
      reminder: true,
    },
    {
      id: 1,
      text: "lecture ap",
      day: "monday",
      reminder: false,
    },
  ]);

  return (
    <>
      {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
